import React from 'react'
import './SideBar.css'
import SideBarData from './SideBarData'
import { Link } from 'react-router-dom'

function SideBar() {
  return (
    <div className="w-1/5 h-screen bg-transparent fixed">
      <nav className="bg-gray-800 h-full">
        <div className="flex items-center justify-center mb-4">
          <img
            src="asserts/logo.png"
            alt=""
            className="m-imag"
          />
        </div>
        <ul className="flex flex-col">
          {SideBarData.map((item, index) => (
            <li
              key={index}
              className={`nav-text h-16 flex items-center ${
                index === 0 ? "bg-blue-500" : ""
              }`}
            >
              <Link
                to={item.path}
                className="w-full h-full flex items-center px-4 text-white hover:bg-blue-500"
              >
                <span>{item.title}</span>
              </Link>
            </li>
          ))}
        </ul>
      </nav>
    </div>
  );
}

export default SideBar
